\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"402854","type":"CustomJS"},{"attributes":{"axis":{"id":"402720"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"402723","type":"Grid"},{"attributes":{"data":{},"selected":{"id":"402578"},"selection_policy":{"id":"402577"}},"id":"402560","type":"ColumnDataSource"},{"attributes":{"fill_alpha":{"value":0.2},"fill_color":{"value":"red"},"hatch_alpha":{"value":0.2},"hatch_color":{"value":"red"},"line_alpha":{"value":0.2},"line_color":{"value":"red"},"size":{"value":8},"x":{"value":1250},"y":{"value":0.07704724509999807}},"id":"402608","type":"Scatter"},{"attributes":{"x0":{"field":"index"},"x1":{"field":"index"},"y0":{"field":"High"},"y1":{"field":"Low"}},"id":"402766","type":"Segment"},{"attributes":{"data":{"Close":{"__ndarray__":"CtejcD2KLEAfhetRuJ4sQClcj8L1qCxAhetRuB4FLEB7FK5H4forQGZmZmZm5itACtejcD0KLEBmZmZmZuYrQDMzMzMzMytAKVyPwvWoKkC4HoXrUbgqQB+F61G4nipAexSuR+F6KkCkcD0K1yMsQOF6FK5HYS1AhetRuB
